HB_FUNC( AP_RPUTS )
{
    request_rec * r = GetRequestRec();
    int iParams = hb_pcount(), iParam;

    for( iParam = 1; iParam <= iParams; iParam++ )
    {
        PHB_ITEM pItem = hb_param( iParam, HB_IT_ANY );

        hb_vmPushSymbol( hb_dynsymGetSymbol( "STR" ) );
        hb_vmPushNil();
        hb_vmPush( pItem );
        hb_vmFunction( 1 );
        ap_rputs( hb_parc( -1 ), r );

        if( iParam != iParams )
        {
            ap_rputs( " ", r );
        }
    }
}

